import React from 'react';
import { SelectElement } from '../../../../Components/SelectElement';
import { CONFIG } from './OutputFilter.config';
import style from '../../style.module.scss';

export default function OutputFilters(props) {
  return (
    <div className={style.outputFilter}>
      <div>
        {CONFIG.FILTERS.map((item) => (
          <SelectElement
            placeholder={item.placeHolder}
            optionList={item.options}
          />
        ))}
      </div>
      <div>
        {CONFIG.SORT.map((item) => (
          <SelectElement
            placeholder={item.placeHolder}
            optionList={item.options}
          />
        ))}
      </div>
    </div>
  );
}
